export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">




    <p>{`In the Swift programming language, nearly everything is based on a named type or compound type. Named types can be assigned names when created. These include `}<em parentName="p">{`classes`}</em>{`, `}<em parentName="p">{`structures`}</em>{`, `}<em parentName="p">{`enumerations`}</em>{`, and `}<em parentName="p">{`protocols`}</em>{`. Instances of user-defined named types carry the name of the given type. For example, a class named `}<inlineCode parentName="p">{`MyClass`}</inlineCode>{` will have the type `}<inlineCode parentName="p">{`MyClass`}</inlineCode>{`. Swift also includes many standard named types for arrays, dictionaries and optional values.`}</p>
    <div class="rounded-md bg-blue-50 p-4">
  <div class="flex">
    <div class="flex-shrink-0">
      <svg class="h-5 w-5 text-blue-400" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor">
        <path fillRule="evenodd" d="M18 10a8 8 0 11-16 0 8 8 0 0116 0zm-7-4a1 1 0 11-2 0 1 1 0 012 0zM9 9a1 1 0 000 2v3a1 1 0 001 1h1a1 1 0 100-2v-3a1 1 0 00-1-1H9z" clipRule="evenodd" />
      </svg>
    </div>
    <div class="ml-3 flex-1 md:flex md:justify-between">
      <p class="text-sm leading-5 text-blue-700">
        This post is the first of several intended a personal growth exercise.
        As I learn and digest new things, I want to write about them to further
        cement my understanding and hold myself accountable.
      </p>
      <p class="mt-3 text-sm leading-5 md:mt-0 md:ml-6">
        <a href="https://fs.blog/2015/01/richard-feynman-knowing-something/" class="whitespace-no-wrap font-medium text-blue-700 hover:text-blue-600 transition ease-in-out duration-150">
          Knowing
          <br />
          vs.
          <br />
          understanding &rarr;
        </a>
      </p>
    </div>
  </div>
    </div>
    <p>{`Compound types are types without a specific name. A compound type may contain other named and compound types. For example, the compound tuple type `}<inlineCode parentName="p">{`(Int, (Int, Int))`}</inlineCode>{` contains two inner types. The first is the named `}<inlineCode parentName="p">{`Int`}</inlineCode>{` type, the second is a compount type of `}<inlineCode parentName="p">{`(Int, Int)`}</inlineCode>{`.`}</p>
    <p>{`Properties are either stored, or computed. A stored property has a fixed value. On the other hand, a computed property is calculated every time it is are accessed. There are also simple observers on properties that listen to changes via callbacks. These observers are `}<inlineCode parentName="p">{`willSet`}</inlineCode>{` and `}<inlineCode parentName="p">{`didSet`}</inlineCode>{`.`}</p>
    <p>{`This was very difficult for me to wrap my head around in my early Swift learning days.`}</p>
    <h3>{`Value types vs Reference types`}</h3>
    <p>{`When a piece of data is saved to disk, it is saved in a container. Imagine each container having a label on the outside. Value types refer to the `}<em parentName="p">{`actual data`}</em>{` inside the container. Reference types refer to the label, or `}<em parentName="p">{`memory address`}</em>{` on the container.`}</p>
    <pre {...{
      "className": "language-swift"
    }}><code parentName="pre" {...{
        "className": "language-Swift"
      }}><span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`class`}</span>{` `}<span parentName="code" {...{
          "className": ""
        }}>{`SimpleClass`}</span>{` `}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`{`}</span>{`
    `}<span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`var`}</span>{` name `}<span parentName="code" {...{
          "className": ""
        }}>{`=`}</span>{` `}<span parentName="code" {...{
          "className": "text-code-green"
        }}>{`""`}</span>{`
`}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`}`}</span>{`

`}<span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`struct`}</span>{` `}<span parentName="code" {...{
          "className": ""
        }}>{`SimpleStruct`}</span>{` `}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`{`}</span>{`
    `}<span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`var`}</span>{` name `}<span parentName="code" {...{
          "className": ""
        }}>{`=`}</span>{` `}<span parentName="code" {...{
          "className": "text-code-green"
        }}>{`""`}</span>{`
`}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`}`}</span>{`

`}<span parentName="code" {...{
          "className": "text-gray-400 italic"
        }}>{`// Memory address is constant but data is variable`}</span>{`
`}<span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`let`}</span>{` simpleClass `}<span parentName="code" {...{
          "className": ""
        }}>{`=`}</span>{` `}<span parentName="code" {...{
          "className": "text-code-blue"
        }}>{`SimpleClass`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`(`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`)`}</span>{`
simpleClass`}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`.`}</span>{`name `}<span parentName="code" {...{
          "className": ""
        }}>{`=`}</span>{` `}<span parentName="code" {...{
          "className": "text-code-green"
        }}>{`"wayne"`}</span>{` `}<span parentName="code" {...{
          "className": "text-gray-400 italic"
        }}>{`// OK`}</span>{`

`}<span parentName="code" {...{
          "className": "text-gray-400 italic"
        }}>{`// Data is constant but address is variable`}</span>{`
`}<span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`let`}</span>{` simpleStruct `}<span parentName="code" {...{
          "className": ""
        }}>{`=`}</span>{` `}<span parentName="code" {...{
          "className": "text-code-blue"
        }}>{`SimpleStruct`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`(`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`)`}</span>{`
simpleStruct`}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`.`}</span>{`name `}<span parentName="code" {...{
          "className": ""
        }}>{`=`}</span>{` `}<span parentName="code" {...{
          "className": "text-code-green"
        }}>{`"wayne"`}</span>{` `}<span parentName="code" {...{
          "className": "text-gray-400 italic"
        }}>{`// Compiler error`}</span>{`
`}</code></pre>
    <p>{`So here we have a constant (let) `}<em parentName="p">{`class`}</em>{` instance with a constant memory address, but its data is variable and can change at any time. This was a huge eye opener for me to learn early on.`}</p>
    <p>{`However, a constant (let) `}<em parentName="p">{`structure`}</em>{` instance has constant data, but a variable memory address. It will throw a compiler error every time the constant structure is changed.`}</p>
    <p>{`Convention tells us to use `}<inlineCode parentName="p">{`struct`}</inlineCode>{` primarily, but should opt for `}<inlineCode parentName="p">{`class`}</inlineCode>{` when our code is designed for instances, as well as interfacing with legacy Objective-C code.`}</p>
    <h3>{`Computed Properties â€” Getters & Setters`}</h3>
    <p>{`Computed properties have special functions for getting and setting of property values. It's value is determined by the getter function every time it's accessed, instead of some stored property with a specific value.`}</p>
    <p>{`Getter functions can retrieve data from storage and setter functions can assign the data to storage directly.`}</p>
    <pre {...{
      "className": "language-swift"
    }}><code parentName="pre" {...{
        "className": "language-Swift"
      }}><span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`var`}</span>{` randomInteger`}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`:`}</span>{` `}<span parentName="code" {...{
          "className": ""
        }}>{`Int`}</span>{` `}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`{`}</span>{`
  `}<span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`get`}</span>{` `}<span parentName="code" {...{
          "className": "text-code-white"
        }}>{`{`}</span>{`
    `}<span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`return`}</span>{` `}<span parentName="code" {...{
          "className": ""
        }}>{`100`}</span>{` `}<span parentName="code" {...{
          "className": ""
        }}>{`*`}</span>{` `}<span parentName="code" {...{
          "className": ""
        }}>{`Int`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`.`}</span><span parentName="code" {...{
          "className": "text-code-blue"
        }}>{`random`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`(`}</span><span parentName="code" {...{
          "className": "text-code-purple"
        }}>{`in`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`:`}</span>{` `}<span parentName="code" {...{
          "className": ""
        }}>{`0`}</span><span parentName="code" {...{
          "className": "text-code-white"
        }}>{`.`}</span><span parentName="code" {...{
